Hello everyone! This is Amelia Sagone
Rattew from @rroma.street. It's a great pleasure to be here in partnership with @streetphotographybrazil to present the beautiful work of Jason Buckley.
@jason__buckley is a British photographer based in London, UK.
Jason is unafraid to explore, experiment, and push the boundaries of street photography, thus creating images that are ambiguous, graphically powerful,
mesmerizing, and just beautiful. His work draws us into
unexpected scenes, offering a mix of quiet poetry and surreal atmosphere.
Congratulations, Jason! I hope you all enjoy his outstanding work.

