@m_h_raines here for my final day of the takeover. After moving back to Portland I decided to put down my film cameras and embrace all things digital. Something about the ease of the camera, the ability to be spontaneous without the costs associated with film, made it a tool that embraces playfulness and mistakism in a way that I really respond to at this moment in my life. I‚Äôm happy to unloosen my grip on control and allow the camera to do weird things for me. Here‚Äôs some recent digital stuff from the past several months. #filmisdead (jk)
