@m_h_raines back again and wanted to show you the work of @treblig_ . I met Gilbert a few months back at one of the @pdxlightleak group meet-ups organized by @swerdnaekalb (more on Blake shortly). I love Gilbert‚Äôs use of neon colors and creating a very atmospheric and singular look that he seems to be able to apply to any subject, detail or landscape.  Everything feels charged by a powerline of energy that buzzes in the most beautiful and strangest of ways. He can make even the most banal of objects like bottles of soap in a bathtub sing with a kind of techno pulse. Go check out his work and give him a follow if you haven‚Äôt already. ‚ö°Ô∏è‚ö°Ô∏è‚ö°Ô∏è
